import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faTwitter,
  faCodepen,
  faInstagram,
} from "@fortawesome/free-brands-svg-icons";
import resim4 from "../Assets/image1.jpg";
import "./section5.css";

export default function Section5() {
  return (
    <>
      <section className="section5 flex flex-col justify-center items-center">
        <span className="contact-title">Send me a message!</span>
        <p className="contact-text">
          Got a question or proposal, or just want <br />
          to say hello? Go ahead.
        </p>
        <span className="contact-mail">imunirbesye@gmail.com</span>
        <ul className="contact-social-media flex flex-row gap-2">
          <li>
            <FontAwesomeIcon
              icon={faTwitter}
              className="contact-social-media-list-item"
            />
          </li>
          <li>
            <FontAwesomeIcon
              icon={faCodepen}
              className="contact-social-media-list-item"
            />
          </li>
          <li>
            <FontAwesomeIcon
              icon={faInstagram}
              className="contact-social-media-list-item"
            />
          </li>
        </ul>
      </section>
    </>
  );
}
